import ReactDOM from 'react-dom';
import React from 'react';

const e = React.createElement;

class MusicApi extends React.Component {
    async componentDidMount() {
        let data = {
            "id": 0,
            "clip_id": 0,
            "detail_clip_id": 0,
            "note_density": 0.1,
            "tempo": 120,
            "case": "start",
            "top_p": 0.949999988079071,
            "superconditioning": 1,
            "clip_start": 0.0,
            "clip_end": 5,
            "selected_region": {
                "start": 1,
                "end": 2
            },
            "notes": [
                "notes",
                1,
                "note",
                76,
                0.0,
                0.0,
                120,
                0
            ]
        }
        let options = {
            method : 'POST',
            headers: {"Content-Type" : "application/json"},
            body: JSON.stringify(data)
        }
        let response = await fetch('https://pia.api.cslmusic.team/', options)
        console.log('hello');
    }

    render() {
        return (<h1>FETCH TEST</h1>);
    }
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<MusicApi />);
